import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {Helmet} from "react-helmet";
import {BrowserRouter, Router,Link,Route,Switch,HashRouter,Redirect} from "react-router-dom";

const Result = ()=>{
  return (
    <HashRouter>
    <Helmet>
    <title>Here's the Title!</title>
        <meta name="description" content="This is what you want to show as the page content in the Google SERP Listing" />
    </Helmet>
    <Switch>
    <Route path="/"  component={App}/>
    </Switch>
    </HashRouter>
  )
}
ReactDOM.render(<Result />, document.getElementById('root'));
